const e=JSON.parse('{"key":"v-714f7799","path":"/suanfa/001.%E4%B8%A4%E6%95%B0%E4%B9%8B%E5%92%8C.html","title":"001-leetcode","lang":"zh-CN","frontmatter":{"title":"001-leetcode","shortTitle":"001-leetcode","category":["算法"],"tag":["leetcode","数组双指针"],"description":"算法日刷","head":[["meta",{"name":"keywords","content":"leetcode题解, 力扣两数之和, 001两数之和, 数组双指针"}],["meta",{"property":"og:url","content":"https://wlei224.gitee.io/suanfa/001.%E4%B8%A4%E6%95%B0%E4%B9%8B%E5%92%8C.html"}],["meta",{"property":"og:site_name","content":"CS_GUIDER"}],["meta",{"property":"og:title","content":"001-leetcode"}],["meta",{"property":"og:description","content":"算法日刷"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:author","content":"WLei224"}],["meta",{"property":"article:tag","content":"leetcode"}],["meta",{"property":"article:tag","content":"数组双指针"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"001-leetcode\\",\\"image\\":[\\"\\"],\\"dateModified\\":null,\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"WLei224\\",\\"url\\":\\"/aboutguider/\\"}]}"]]},"headers":[],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":2.18,"words":654},"filePathRelative":"suanfa/001.两数之和.md","excerpt":"<blockquote>\\n<blockquote>\\n<blockquote>\\n<p>今天来搞一搞力扣的经典劝退题，有人相爱，有人夜里开车看海，有人<code>leetcode</code>第一题都做不出来。滴~~~今天不玩梗，玩代码！</p>\\n</blockquote>\\n</blockquote>\\n</blockquote>\\n<ul>\\n<li>\\n<p><code>leetCode：</code>001.两数之和</p>\\n</li>\\n<li>\\n<p><code>describution:</code></p>\\n</li>\\n</ul>\\n<blockquote>\\n<p>给定一个整数数组 <code>nums</code> 和一个整数目标值 <code>target</code>，请你在该数组中找出 <strong>和为目标值</strong> <em><code>target</code></em> 的那 <strong>两个</strong> 整数，并返回它们的数组下标。</p>\\n<p>你可以假设每种输入只会对应一个答案。但是，数组中同一个元素在答案里不能重复出现。</p>\\n<p>你可以按任意顺序返回答案。</p>\\n<p><strong>示例 1：</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>输入：nums = [2,7,11,15], target = 9\\n输出：[0,1]\\n解释：因为 nums[0] + nums[1] == 9 ，返回 [0, 1] 。\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>示例 2：</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>输入：nums = [3,2,4], target = 6\\n输出：[1,2]\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>示例 3：</strong></p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>输入：nums = [3,3], target = 6\\n输出：[0,1]\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div><p><strong>提示：</strong></p>\\n<ul>\\n<li><code>2 &lt;= nums.length &lt;= 104</code></li>\\n<li><code>-109 &lt;= nums[i] &lt;= 109</code></li>\\n<li><code>-109 &lt;= target &lt;= 109</code></li>\\n<li><strong>只会存在一个有效答案</strong></li>\\n</ul>\\n</blockquote>"}');export{e as data};
